// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

contract CSEnrollment {
    address public owner;

    //enrollment types
    enum EnrollmentType {
        UNDERGRADUATE,
        GRADUATE
    }

    //course structure
    struct Course {
        uint256 number;
        EnrollmentType courseType;
        bool gradsCanEnroll;
        bool exists;
        uint256 registeredCount;
    }

    //registered student structure
    struct Registered {
        address id;
        uint256 courseNum;
        uint256 timestamp;
        uint256 credits;
        bool exists;
    }

    //student structure
    struct Student {
        address id;
        uint256 credits;
        bool exists;
        EnrollmentType courseType;
    }

    //varibles for mapping to store info

    mapping(address => Student) public students;

    mapping(uint256 => Course) public courses;

    mapping(uint256 => Registered) public registered;

    mapping(uint256 => address[]) public courseStudents;

    constructor() {
        owner = msg.sender;

        // Initialize some courses
        courses[670] = Course(670, EnrollmentType.GRADUATE, true, true, 0);
        courses[617] = Course(617, EnrollmentType.GRADUATE, true, true, 0);
        courses[484] = Course(484, EnrollmentType.UNDERGRADUATE, true, true, 0);
        courses[431] = Course(431, EnrollmentType.UNDERGRADUATE, false, true, 0);
    }

    //owner access only
    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can call this function");
        _;
    }

    //student register for course
    function register(
        uint256 credits,
        EnrollmentType studentType,
        uint256 courseNum
    ) public {
        //add check if student is already registered
        require(students[msg.sender].exists == false, "Student is already registered");

        // add check for course full (30)
        require(courseStudents[courseNum].length < 30, "Course is already full");

        if (studentType == EnrollmentType.UNDERGRADUATE) {
            //undergrad check
            require(
                courseNum == 484 || courseNum == 431,
                "Undergraduates can only register for courses 484 or 431"
            );
        } else if (studentType == EnrollmentType.GRADUATE) {
            //credit check and grad check
            require(credits > 20, "Graduates must have over 20 credits to register");
            require(
                courseNum != 431,
                "Graduates are not allowed to register for course 431"
            );
        }

        //check for valid course number
        require(courses[courseNum].exists, "Invalid course number");

        //register for course
        students[msg.sender] = Student(msg.sender, credits, true, studentType);
        registered[courseNum] = Registered(
            msg.sender,
            courseNum,
            block.timestamp,
            credits,
            true
        );
        courses[courseNum].registeredCount++;
        courseStudents[courseNum].push(msg.sender);
    }

    //add new course
    function add(uint256 courseNumber, EnrollmentType courseType) public onlyOwner {
        //see if course exists
        require(!courses[courseNumber].exists, "Course already exists");

        courses[courseNumber] = Course(courseNumber, courseType, true, true, 0);
    }

    //rester of students
    function getRoster(uint256 courseNum) public view returns (address[] memory) {
        return courseStudents[courseNum];
    }
}

